import React from "react";

const ContactList = (props) => {
    // console.log(props);
    const renderedContactList = props.contacts.map((contacts) => {
        return (
            <div className="item">
                <div className="content">
                    <div className="header">{contacts.name}</div>
                    <div>{contacts.email}</div>
                    <i className="trash alternate outline icon right"></i>
                </div>
                
            </div>
        );
    })
    return (
        <div className="ui celled list">
            <h3>Contact List</h3>
            {renderedContactList}
        </div>
    )
}
export default ContactList;
